      "import { AxiosRequestConfig } from 'axios';\n\nimport { API_URLS } from '../../constants/apiConstants';\nimport { TV_LOGIN_TYPE } from '../../constants/commonConstants';\nimport { GATEWAY_URL } from '../../utils/common/apiConfig';\nimport httpPost from '../../utils/http/httpPost';\nimport { AppLoginBody, NewTvingResponse } from '../types';\n\nexport interface AppLoginParameter {\n  userId: string;\n  password: string;\n  loginType: string;\n  deviceId: string;\n  deviceName: string;\n  deviceModel?: string;\n}\n\n/**\n *   /   .\n */\nconst fetchAppLogin = (requestParameter: AppLoginParameter, requestConfig?: AxiosRequestConfig): Promise<NewTvingResponse<AppLoginBody>> => {\n  const { userId, password, loginType, deviceId, deviceName, deviceModel } = requestParameter;\n  //      \n  if (!userId && !password && !loginType && !deviceId && deviceName) {\n    throw new Error('fetchAppLogin: requestParameter is invalid');\n  }\n\n  const requestBodyParams = JSON.stringify({\n    userId,\n    password,\n    loginType,\n    deviceId,\n    deviceName,\n    deviceModel,\n  });\n\n  const loginPath = loginType === TV_LOGIN_TYPE.TVING_ID ? 'tving' : 'cjone';\n\n  const filledRequestConfig = {\n    ...requestConfig,\n    data: requestBodyParams,\n  };\n  return httpPost<NewTvingResponse<AppLoginBody>>(`${GATEWAY_URL}${API_URLS.APP_LOGIN}${loginPath}`, filledRequestConfig)\n    .then((response) => {\n      return response;\n    })\n    .catch((e) => {\n      throw e;\n    });\n};\n\nexport default fetchAppLogin;\n",
