      "import React from 'react';\n\nimport { useMutation, useQuery } from '@tanstack/react-query';\nimport dayjs from 'dayjs';\nimport { DurationUnitsObjectType } from 'dayjs/plugin/duration';\n\nimport { DAYS_IN_A_WEEK } from '../../../constants/dateConstants';\n\ninterface Options {\n  expiration?: DurationUnitsObjectType;\n  puid?: number | string | symbol;\n}\n\ninterface Params {\n  key: string;\n  options: Options;\n}\n\ninterface LocalStorageData {\n  expirationTime: dayjs.Dayjs;\n}\n\nconst LOCALSTORAGE_KEY_PREFIX = '_TVING_POPUP_KEY';\n\n// localStorage key  \nconst makeLocalStorageKey = (key, puid) => [LOCALSTORAGE_KEY_PREFIX, key, puid].filter((key) => key).join('_');\n\n// localStorage      \nconst saveToLocalStorage = ({ key, options: { expiration, puid } }: Params) => {\n  return new Promise((resolve, reject) => {\n    if (!expiration) {\n      reject(new Error('  .'));\n      return;\n    }\n\n    const data = {\n      expirationTime: dayjs().add(dayjs.duration(expiration)),\n    };\n\n    const localStorageKey = makeLocalStorageKey(key, puid);\n\n    localStorage.setItem(localStorageKey, JSON.stringify(data));\n    resolve('success');\n  });\n};\n\n// localStorage      \nconst loadFromLocalStorage = ({ key, options: { puid } }: Params) => {\n  const localStorageKey = makeLocalStorageKey(key, puid);\n\n  const value = localStorage.getItem(localStorageKey);\n  return value ? JSON.parse(value) : null;\n};\n\nconst useDisablePopupPerBrowser = (key: string, { puid, expiration = { days: DAYS_IN_A_WEEK } }: Options = {}) => {\n  const options = {\n    expiration,\n    puid,\n  };\n\n  const { data, isLoading } = useQuery<LocalStorageData>(['popup', 'config', key, puid], () => loadFromLocalStorage({ key, options }), {\n    cacheTime: 0,\n    staleTime: 0,\n  });\n  const { mutateAsync } = useMutation(() => saveToLocalStorage({ key, options }), {});\n\n  let isShow = data?.expirationTime ? dayjs().isAfter(data?.expirationTime) : true;\n  if (key === '') {\n    isShow = false;\n  }\n\n  return { data, isShow, isLoading, mutateAsync };\n};\n\nexport default useDisablePopupPerBrowser;\n",
