    source:
      "import { CONTENT_LABEL_TYPE, DEVICE_TYPE } from '../../constants/commonConstants';\nimport { TvItem } from '../../proxies/types';\nimport getDeviceType from '../common/getDeviceType/getDeviceType';\n\nconst getTvContentLabels = (tvItem: TvItem): CONTENT_LABEL_TYPE[] => {\n  const contentLabelArr: CONTENT_LABEL_TYPE[] = [];\n  const deviceType = getDeviceType();\n\n  const { label, hdrCode, audioCode } = tvItem;\n  const { isExplainSubtitle, isUhd4k, isFree, isDrm, isSubtitle, isDubbing, isQuickVod } = label || {};\n\n  if (isQuickVod) {\n    contentLabelArr.push(CONTENT_LABEL_TYPE.QUICK_VOD);\n  }\n\n  if (isUhd4k) {\n    contentLabelArr.push(CONTENT_LABEL_TYPE.UHD_4K);\n  }\n\n  // \n  if (isSubtitle) {\n    contentLabelArr.push(CONTENT_LABEL_TYPE.SUBTITLE);\n  }\n  // \n  if (isDubbing) {\n    contentLabelArr.push(CONTENT_LABEL_TYPE.DUBBING);\n  }\n\n  // HDR\n  if (hdrCode === '01') {\n    contentLabelArr.push(CONTENT_LABEL_TYPE.HDR);\n  } else if (hdrCode === '02') {\n    if (deviceType === DEVICE_TYPE.TIZEN) {\n      contentLabelArr.push(CONTENT_LABEL_TYPE.HDR10_PLUS);\n    } else {\n      contentLabelArr.push(CONTENT_LABEL_TYPE.HDR);\n    }\n  } else if (hdrCode === '03') {\n    contentLabelArr.push(CONTENT_LABEL_TYPE.DOLBY_VISION);\n  }\n\n  if (audioCode === '01') {\n    contentLabelArr.push(CONTENT_LABEL_TYPE.DOLBY_51);\n  } else if (audioCode === '03') {\n    contentLabelArr.push(CONTENT_LABEL_TYPE.DTX);\n  }\n\n  if (isExplainSubtitle) {\n    contentLabelArr.push(CONTENT_LABEL_TYPE.EXPLAIN_SUBTITLE);\n  }\n  if (isFree) {\n    contentLabelArr.push(CONTENT_LABEL_TYPE.FREE_META);\n  }\n  return contentLabelArr;\n};\n\nexport default getTvContentLabels;\n",
