    source:
      "import { RefObject, useCallback, useEffect, useMemo, useRef, useState } from 'react';\n\nimport DebouncedFunc from 'lodash/function';\nimport noop from 'lodash/noop';\nimport uniqueId from 'lodash/uniqueId';\n\nimport { TV_PAGE } from '../../../constants/commonConstants';\nimport { CHILDREN_ENDPOINT_ACTION } from '../contants';\nimport TvingFocusable from '../TvingFocusable';\nimport { ChildrenEndPointAction, FocusableComponentLayout, FocusableComponentProps, FocusDetails, KeyPressDetails, NavigationType } from '../types';\n\nimport { useFocusContext, useFocusRoot } from './useFocusedContext';\n\ninterface UseFocusableProps {\n  focusable?: boolean;\n  saveLastFocusedChild?: boolean;\n  trackChildren?: boolean;\n  autoRestoreFocus?: boolean;\n  isInactive?: boolean;\n  isFocusBoundary?: boolean;\n  focusKey?: string;\n\n  navigationType?: NavigationType;\n  focusIndex?: number;\n\n  preferredChildFocusKey?: string;\n  onEnterPress?: (props: object, details: KeyPressDetails) => void;\n  onEnterRelease?: (props: object) => void;\n  onArrowPress?: (direction: string, props: object, details: KeyPressDetails) => boolean;\n  onBackPress?: (details: KeyPressDetails) => void;\n  onFocus?: (layout: FocusableComponentLayout, props: object, details: FocusDetails) => void;\n  onBlur?: (layout: FocusableComponentLayout, props: object, details: FocusDetails) => void;\n  onChildrenEndPointEvent?: (direction: string, details: KeyPressDetails) => void;\n  extraProps?: object;\n  childrenEndPointAction?: ChildrenEndPointAction;\n  overlapChildren?: boolean; // true      \n}\n\nexport interface UseFocusableResult {\n  ref: RefObject<any>; // <any> since we don't know which HTML tag is passed here\n  focusSelf: () => void;\n  focused: boolean;\n  hasFocusedChild: boolean;\n  focusKey: string;\n  focusIndex: number;\n  parentFocusKey: string;\n  setFocus: (focusKey: string) => void;\n  getComponentByFocusKey: (focusKey: string) => FocusableComponentProps | undefined;\n  getCurrentFocus: () => string;\n  navigateByDirection: (direction: string, focusDetails?: FocusDetails) => void;\n  pause: () => void;\n  resume: () => void;\n  updateAllLayouts: () => void;\n  focusable: boolean;\n\n  tvingFocusableRef: RefObject<TvingFocusable>;\n  keyDownEventListener: ((event: KeyboardEvent) => boolean) | DebouncedFunc<(event: KeyboardEvent) => boolean>;\n  keyUpEventListener: (event: KeyboardEvent) => boolean;\n}\n\nconst useFocusableHook = ({\n  focusable = true,\n  saveLastFocusedChild = true,\n  trackChildren = false,\n  autoRestoreFocus = true,\n  isInactive = false,\n  isFocusBoundary = false,\n  focusKey: propFocusKey,\n  navigationType = NavigationType.SPATIAL,\n  focusIndex,\n  preferredChildFocusKey,\n  onChildrenEndPointEvent = noop,\n  onEnterPress = noop,\n  onEnterRelease = noop,\n  onArrowPress = () => true,\n  onBackPress,\n  onFocus = noop,\n  onBlur = noop,\n  extraProps,\n  childrenEndPointAction = CHILDREN_ENDPOINT_ACTION.NONE,\n  overlapChildren = false,\n}: UseFocusableProps = {}): UseFocusableResult => {\n  const onEnterPressHandler = useCallback(\n    (details: KeyPressDetails) => {\n      onEnterPress(extraProps || {}, details);\n    },\n    [onEnterPress, extraProps],\n  );\n\n  const onEnterReleaseHandler = useCallback(() => {\n    onEnterRelease(extraProps || {});\n  }, [onEnterRelease, extraProps]);\n\n  const onArrowPressHandler = useCallback(\n    (direction: string, details: KeyPressDetails) => onArrowPress(direction, extraProps || {}, details),\n    [extraProps, onArrowPress],\n  );\n\n  const onFocusHandler = useCallback(\n    (layout: FocusableComponentLayout, details: FocusDetails) => {\n      onFocus(layout, extraProps || {}, details);\n    },\n    [extraProps, onFocus],\n  );\n\n  const onBlurHandler = useCallback(\n    (layout: FocusableComponentLayout, details: FocusDetails) => {\n      onBlur(layout, extraProps || {}, details);\n    },\n    [extraProps, onBlur],\n  );\n  const onChildrenEndPointEventHandler = useCallback(\n    (direction: string, details: KeyPressDetails) => onChildrenEndPointEvent(direction, details),\n    [onChildrenEndPointEvent],\n  );\n\n  const ref = useRef(null);\n\n  const [focused, setFocused] = useState(false);\n  const [hasFocusedChild, setHasFocusedChild] = useState(false);\n\n  const rootFocusKey = useFocusRoot();\n  if (!rootFocusKey) {\n    throw new Error('useFocusable must be used inside a FocusRoot');\n  }\n  const tvingFocusable = TvingFocusable.getInstance(rootFocusKey as TV_PAGE);\n\n  const parentFocusKey = useFocusContext();\n\n  /**\n   * Either using the propFocusKey passed in, or generating a random one\n   */\n  const focusKey = useMemo(() => propFocusKey || uniqueId('TVING_'), [propFocusKey]);\n\n  const focusSelf = useCallback(() => {\n    tvingFocusable.setFocus(focusKey);\n  }, [focusKey]);\n\n  useEffect(() => {\n    const node = ref.current;\n    if (node) {\n      tvingFocusable.addFocusable({\n        focusKey,\n        navigationType,\n        focusIndex,\n        node,\n        parentFocusKey,\n        preferredChildFocusKey,\n        onEnterPress: onEnterPressHandler,\n        onEnterRelease: onEnterReleaseHandler,\n        onArrowPress: onArrowPressHandler,\n        onBackPress,\n        onFocus: onFocusHandler,\n        onBlur: onBlurHandler,\n        onUpdateFocus: (isFocused = false) => setFocused(isFocused),\n        onUpdateHasFocusedChild: (isFocused = false) => setHasFocusedChild(isFocused),\n        saveLastFocusedChild,\n        trackChildren,\n        isInactive,\n        isFocusBoundary,\n        onChildrenEndPointEvent: onChildrenEndPointEventHandler,\n        autoRestoreFocus,\n        focusable,\n        childrenEndPointAction,\n        overlapChildren,\n      });\n    }\n\n    return () => {\n      tvingFocusable.removeFocusable({\n        focusKey,\n      });\n    };\n  }, []);\n\n  useEffect(() => {\n    const node = ref.current;\n    if (node) {\n      tvingFocusable.updateFocusable(focusKey, {\n        node,\n        preferredChildFocusKey,\n        focusable,\n        isFocusBoundary,\n        onEnterPress: onEnterPressHandler,\n        onEnterRelease: onEnterReleaseHandler,\n        onArrowPress: onArrowPressHandler,\n        onBackPress,\n        onFocus: onFocusHandler,\n        onBlur: onBlurHandler,\n        onChildrenEndPointEvent: onChildrenEndPointEventHandler,\n      });\n    }\n  }, [\n    focusKey,\n    preferredChildFocusKey,\n    focusable,\n    isFocusBoundary,\n    onEnterPressHandler,\n    onEnterReleaseHandler,\n    onArrowPressHandler,\n    onBackPress,\n    onFocusHandler,\n    onBlurHandler,\n    onChildrenEndPointEventHandler,\n  ]);\n\n  const tvingFocusableRef = useRef<TvingFocusable>(tvingFocusable);\n\n  return {\n    ref,\n    focusSelf,\n    focused,\n    hasFocusedChild,\n    focusKey, // returns either the same focusKey as passed in, or generated one\n    focusIndex: focusIndex as number,\n    parentFocusKey,\n    setFocus: tvingFocusable.isNativeMode() ? noop : tvingFocusable.setFocus.bind(tvingFocusable),\n    getComponentByFocusKey: tvingFocusable.getComponentByFocusKey.bind(tvingFocusable),\n    getCurrentFocus: tvingFocusable.getCurrentFocus.bind(tvingFocusable),\n    navigateByDirection: tvingFocusable.navigateByDirection.bind(tvingFocusable),\n    pause: tvingFocusable.pause.bind(tvingFocusable),\n    resume: tvingFocusable.resume.bind(tvingFocusable),\n    updateAllLayouts: tvingFocusable.updateAllLayouts.bind(tvingFocusable),\n    focusable,\n    tvingFocusableRef,\n    keyDownEventListener: tvingFocusable.keyDownEventListener.bind(tvingFocusable),\n    keyUpEventListener: tvingFocusable.keyUpEventListener.bind(tvingFocusable),\n  };\n};\n\nexport const useFocusable = useFocusableHook;\n",
