      "import * as Sentry from '@sentry/react';\n\nimport amplitudeEvent, { AmplitudeEventProps } from '../amplitude/amplitudeEvent';\n\nexport interface TvingLogModuleOption {\n  isConsole?: boolean;\n}\n\nconst logDomWithCSS = (dom: HTMLElement, args: unknown[], css: string) => {\n  const messages = args.reduce((acc, cur) => {\n    if (typeof cur === 'object' || Array.isArray(cur)) {\n      return `${acc} ${JSON.stringify(cur)}`;\n    }\n    return `${acc} ${cur}`;\n  }, '');\n\n  const logDom = document.createElement('p');\n  logDom.setAttribute('style', css);\n  logDom.innerText = messages as string;\n  dom.appendChild(logDom);\n};\n\nconst consoleWithCSS = (console: Console, args: unknown[], css: string) => {\n  const messages = args.reduce((acc, cur) => {\n    if (typeof cur === 'object' || Array.isArray(cur)) {\n      return `${acc} ${JSON.stringify(cur)}`;\n    }\n    return `${acc} ${cur}`;\n  }, '');\n\n  console.log(`%c${messages}`, css);\n};\n\nexport interface AmplitudeEventDefaultPropertiesProps {\n  mediatype: string | null;\n  channel_code: string | null;\n  channel_name: string | null;\n  code: string | null;\n  program_code: string | null;\n  program_name: string | null;\n  ctgr_name: string | null;\n  ctgr_code: string | null;\n}\nenum LOG_LEVEL {\n  TRACE,\n  DEBUG,\n  INFO,\n  WARN,\n  ERROR,\n  FATAL,\n}\n\n/**\n * TvingLogModule Sentry, Console     .\n *\n */\nclass TvingLogModule {\n  private isDebug = process.env.NODE_ENV === 'development';\n\n  private isReal = process.env.REACT_APP_RELEASE === 'PRODUCTION';\n\n  private readonly console: Console;\n\n  private readonly sentry: typeof Sentry;\n\n  private consoleDom: HTMLElement | null = null;\n\n  private logLevel: LOG_LEVEL = LOG_LEVEL.DEBUG;\n\n  //  DOM   \n  private isConsole = false;\n\n  isAmplitudeConsole = false;\n\n  lastPageView = '';\n\n  constructor(option?: TvingLogModuleOption) {\n    this.console = console;\n    this.sentry = Sentry;\n    this.isConsole = !this.isReal && !!option?.isConsole;\n\n    if (!this.isReal) {\n      this.registerKeydownEvent();\n    }\n\n    if (this.isConsole) {\n      this.drawConsoleDom();\n    }\n  }\n\n  registerKeydownEvent() {\n    document.addEventListener('keydown', (e) => {\n      // noinspection JSDeprecatedSymbols\n      switch (e.keyCode) {\n        case 48: {\n          if (this.consoleDom) {\n            this.consoleDom.innerHTML = '';\n          }\n          break;\n        }\n\n        case 49: {\n          this.isConsole = !this.isConsole;\n          if (this.isConsole) {\n            this.drawConsoleDom();\n          } else if (this.consoleDom) {\n            document.body.removeChild(this.consoleDom);\n          }\n          break;\n        }\n\n        default:\n          break;\n      }\n    });\n  }\n\n  drawConsoleDom() {\n    const consoleDom = document.getElementById('tving-console');\n    if (consoleDom) {\n      this.consoleDom = consoleDom;\n    } else {\n      this.consoleDom = document.createElement('div');\n      this.consoleDom.setAttribute('id', 'tving-console');\n      document.body.appendChild(this.consoleDom);\n    }\n  }\n\n  log(style: string, logLevel: LOG_LEVEL, ...args) {\n    if (this.logLevel > logLevel) {\n      return;\n    }\n\n    if (this.isConsole && this.consoleDom) {\n      logDomWithCSS(this.consoleDom, args, style);\n    }\n\n    if (this.isDebug) {\n      consoleWithCSS(this.console, args, style);\n      this.console.groupCollapsed('Call stack');\n      this.console.trace(); // hidden in collapsed group\n      this.console.groupEnd();\n    } else {\n      this.sentry.addBreadcrumb({\n        category: 'log',\n        message: JSON.stringify(args),\n        level: 'debug',\n      });\n    }\n  }\n\n  trace(...args) {\n    if (args) {\n      // eslint-disable-next-line @typescript-eslint/no-unsafe-argument\n      this.log('background: skyblue; color: black', LOG_LEVEL.TRACE, ...args);\n    }\n  }\n\n  traceSentry(message: string, extra?: Record<string, unknown>, tags?: { [key: string]: string }) {\n    this.sentry.captureMessage(message, {\n      level: 'log',\n      extra,\n      tags,\n    });\n  }\n\n  debug(...args) {\n    if (args) {\n      // eslint-disable-next-line @typescript-eslint/no-unsafe-argument\n      this.log('background: green; color: yellow', LOG_LEVEL.DEBUG, ...args);\n    }\n  }\n\n  debugSentry(message: string, extra?: Record<string, unknown>, tags?: { [key: string]: string }) {\n    this.sentry.captureMessage(message, {\n      level: 'debug',\n      extra,\n      tags,\n    });\n  }\n\n  info(...args) {\n    if (args) {\n      // eslint-disable-next-line @typescript-eslint/no-unsafe-argument\n      this.log('background: black; color: white', LOG_LEVEL.INFO, ...args);\n    }\n  }\n\n  infoSentry(message: string, extra?: Record<string, unknown>, tags?: { [key: string]: string }) {\n    this.sentry.captureMessage(message, {\n      level: 'info',\n      extra,\n      tags,\n    });\n  }\n\n  warn(...args) {\n    if (args) {\n      // eslint-disable-next-line @typescript-eslint/no-unsafe-argument\n      this.log('background: orange; color: red', LOG_LEVEL.WARN, ...args);\n    }\n  }\n\n  warnSentry(message: string, extra?: Record<string, unknown>, tags?: { [key: string]: string }) {\n    this.sentry.captureMessage(message, {\n      level: 'warning',\n      extra,\n      tags,\n    });\n  }\n\n  error(...args) {\n    if (args) {\n      // eslint-disable-next-line @typescript-eslint/no-unsafe-argument\n      this.log('background: darkred; color: yellow', LOG_LEVEL.ERROR, ...args);\n    }\n  }\n\n  errorSentry(message: string, extra?: Record<string, unknown>, tags?: Record<string, string>) {\n    this.sentry.captureMessage(message, {\n      level: 'error',\n      extra,\n    });\n  }\n\n  getLastPageView() {\n    return this.lastPageView;\n  }\n\n  amplitudeEvent({ event, eventProperties }: AmplitudeEventProps) {\n    amplitudeEvent({\n      event,\n      eventProperties,\n    });\n\n    if (this.isAmplitudeConsole) {\n      this.console.log('amplitudeEvent');\n    }\n  }\n}\n\nexport default new TvingLogModule();\n",
