    source:
      "import React, { SetStateAction, useCallback, useEffect, useMemo, useRef, useState } from 'react';\n\nimport Hangul from 'hangul-js';\nimport { SEARCH_TYPE } from 'tv/src/layers/search';\n\nimport { FOCUS_KEY } from '../../constants/focusKeyConstants';\nimport { FocusParentContext, useFocusable } from '../tving-focusable';\nimport { CHILDREN_ENDPOINT_ACTION, DIRECTION_UP, KEY_CODE } from '../tving-focusable/contants';\n\nimport tv from './layouts/tv';\nimport StyledTvingVirtualKeyboard from './TvingVirtualKeyboard.style';\nimport TvingVirtualKeyboardItem from './TvingVirtualKeyboardItem';\nimport { KEYBOARD_CODE } from './types';\n\ninterface TvingVirtualKeyboardProps {\n  handleAssembleText: (text: string) => void;\n  assembleText?: string;\n  setSearchType?: React.Dispatch<SetStateAction<SEARCH_TYPE>>;\n  disabledKeys?: string[];\n  handleNextKeyPress?: (text: string) => void;\n  handlePrevKeyPress?: () => void;\n}\n\nconst TvingVirtualKeyboard = ({\n  handleAssembleText,\n  assembleText,\n  setSearchType,\n  disabledKeys,\n  handleNextKeyPress,\n  handlePrevKeyPress,\n}: TvingVirtualKeyboardProps) => {\n  const { korean, english, login, loginUppercase } = tv;\n  const [keyboard, setKeyboard] = useState(setSearchType ? korean : login);\n  const { ref, focusKey, setFocus, getCurrentFocus } = useFocusable({\n    // eslint-disable-next-line no-nested-ternary\n    preferredChildFocusKey: keyboard === korean ? 'TVING_VK_' : keyboard === english ? 'TVING_VK_a' : 'TVING_VK_1',\n    childrenEndPointAction: setSearchType ? CHILDREN_ENDPOINT_ACTION.LOOP_UP : CHILDREN_ENDPOINT_ACTION.NONE,\n    focusKey: FOCUS_KEY.TVING_VIRTUAL_KEYBOARD(),\n    saveLastFocusedChild: false,\n    onFocus: (_, __, details) => {\n      const { key, keyCode } = details.event || {};\n      if (key === DIRECTION_UP || keyCode === KEY_CODE.UP) {\n        // eslint-disable-next-line no-nested-ternary\n        setFocus(keyboard === korean ? 'TVING_VK_' : keyboard === english ? 'TVING_VK_8' : 'TVING_VK_;');\n      }\n    },\n  });\n\n  const text = useRef([] as string[]);\n  const isFirst = useRef(true);\n\n  const handlePressKeyboard = useCallback(\n    (value: string) => {\n      if (value === KEYBOARD_CODE.LANGUAGE_KOR) {\n        setKeyboard(korean);\n      } else if (value === KEYBOARD_CODE.LANGUAGE_ENG) {\n        setKeyboard(english);\n      } else {\n        if (value === KEYBOARD_CODE.SPACE) {\n          //        \n          if (text.current.length > 0 && text.current[text.current.length - 1] !== ' ') {\n            text.current.push(' ');\n          }\n        } else if (value === KEYBOARD_CODE.DELETE || value === KEYBOARD_CODE.LOGIN_DELETE) {\n          text.current.pop();\n        } else if (value === KEYBOARD_CODE.DELETE_ALL) {\n          text.current = [] as string[];\n        } else if (value === KEYBOARD_CODE.UPPER) {\n          setKeyboard(loginUppercase);\n        } else if (value === KEYBOARD_CODE.LOWER) {\n          setKeyboard(login);\n        } else if (value === KEYBOARD_CODE.NEXT && handleNextKeyPress) {\n          handleNextKeyPress(Hangul.assemble(text.current));\n          isFirst.current = true;\n          if (keyboard === loginUppercase) {\n            setKeyboard(login);\n          }\n          return;\n        } else if (value === KEYBOARD_CODE.PREV && handlePrevKeyPress) {\n          handlePrevKeyPress();\n          isFirst.current = true;\n          if (keyboard === loginUppercase) {\n            setKeyboard(login);\n          }\n          setFocus('TVING_VK_1');\n          return;\n        } else {\n          text.current.push(value);\n        }\n\n        handleAssembleText(Hangul.assemble(text.current));\n      }\n      if (setSearchType) {\n        setSearchType(SEARCH_TYPE.KEYBOARD);\n      }\n    },\n    [\n      setSearchType,\n      korean,\n      english,\n      handleNextKeyPress,\n      handlePrevKeyPress,\n      handleAssembleText,\n      loginUppercase,\n      login,\n      keyboard,\n      disabledKeys,\n      setFocus,\n    ],\n  );\n\n  useEffect(() => {\n    if (disabledKeys && disabledKeys?.indexOf(getCurrentFocus().split('TVING_VK_')[1]) > -1) {\n      setFocus('TVING_VK_1');\n    }\n  }, [disabledKeys]);\n\n  /**\n   *     text   \n   */\n  useEffect(() => {\n    if (assembleText !== Hangul.assemble(text.current)) {\n      text.current = Hangul.disassemble(assembleText as string);\n    }\n  }, [assembleText]);\n\n  useEffect(() => {\n    if (keyboard && !isFirst.current) {\n      let targetFocusKey: string;\n      switch (keyboard) {\n        case english:\n          targetFocusKey = `TVING_VK_${KEYBOARD_CODE.LANGUAGE_KOR}`;\n          break;\n        case login:\n          targetFocusKey = `TVING_VK_${KEYBOARD_CODE.UPPER}`;\n          break;\n        case loginUppercase:\n          targetFocusKey = `TVING_VK_${KEYBOARD_CODE.LOWER}`;\n          break;\n        default:\n          targetFocusKey = `TVING_VK_${KEYBOARD_CODE.LANGUAGE_ENG}`;\n      }\n      setFocus(targetFocusKey);\n    }\n    if (isFirst.current) {\n      isFirst.current = false;\n    }\n    // eslint-disable-next-line react-hooks/exhaustive-deps\n  }, [keyboard, korean]);\n\n  const buttons = useMemo(() => {\n    return keyboard.map((values, index) => {\n      return (\n        <section key={`${values}_${index}`}>\n          {values.split(' ').map((value, index) => {\n            return (\n              <TvingVirtualKeyboardItem\n                keyboard={keyboard}\n                key={index.toString()}\n                handleClick={() => {\n                  handlePressKeyboard(value);\n                }}\n                isActivated={!disabledKeys || disabledKeys?.indexOf(value) === -1}\n              >\n                {value}\n              </TvingVirtualKeyboardItem>\n            );\n          })}\n        </section>\n      );\n    });\n  }, [handlePressKeyboard, keyboard, disabledKeys]);\n  return (\n    <FocusParentContext.Provider value={focusKey}>\n      <StyledTvingVirtualKeyboard ref={ref}>{buttons}</StyledTvingVirtualKeyboard>\n    </FocusParentContext.Provider>\n  );\n};\nexport default TvingVirtualKeyboard;\n",
